// -------------------- Import --------------------
import React, { Component } from "react";
import { NavLink } from "react-router-dom";

// -------------------- Main Bar --------------------
export default class MainBar extends Component {
  render() {
    return (
      <section className="main_bar">
        <img
            src="https://ak-static.cms.nba.com/wp-content/uploads/logos/leagues/logo-gleague.svg"
            alt=""
          />
{/* Title */}
        <h1>NBA</h1>
{/* Logo */}
        <div>LOGO</div>
{/* Players */}
        <NavLink to="/Players">
          <button>Players</button>
        </NavLink>
{/* Teams */}
        <NavLink to="/Teams">
          <button>Teams</button>
        </NavLink>
      </section>
    );
  }
}
